import React from "react";

const Nav = function(){
    return(
        <nav>
        <p>GameSpace</p>
        <menu>
            <ul>
                <li><a>Home</a></li>
                <li><a>Shop</a></li>
                <li><a>Library</a></li>
                <li><a>Report</a></li>
            </ul>
        </menu>
        <button>Login</button>
    </nav>
    );
}

export default Nav;
